import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Profile(){
    return(
        <div>
            <Navbar/>
            <div className="container d-flex flex-column justify-content-center col-5 my-5">
               
                <p className="h2">Personal Information</p>
                <hr/>
                <label> Username:</label><br/>
                <input placeholder="Username"></input><br/>
                <label> First Name:</label><br/>
                <input placeholder="First Name"></input><br/>
                <label> Last Name:</label><br/>
                <input placeholder="Last Name"></input><br/>
                    
                
                
            </div>
            <Footer/>
        </div>
    )
    
}

export default Profile;
